import React from "react";
import './App.css';

import AddTodo from "./layouts/AddTodo";
import FilterPanel from "./layouts/FilterPanel";
import Todos from "./layouts/Todos";

const App = () => {
  return (
    <div className="container">
      <h1>Todo List</h1>
      <div className="content_todo">
      <AddTodo />
      <FilterPanel />
      <Todos />
      </div>
    </div>
  )
}

export default App;
